import './App.css';
import { IonPage, IonRoute, IonRouterOutlet } from '@ionic/react';
import Headers from './components/header/Headers';
import Footer from './components/footer/footer';
import { IonReactRouter } from '@ionic/react-router';
import Login from './pages/Login';
import {Route} from 'react-router-dom';

function App() {
  return (
    <IonPage>
      <IonReactRouter>
        <IonRouterOutlet>
            <Route path='/login'>
                <Login/>
            </Route>
        </IonRouterOutlet>
      </IonReactRouter>
      <Headers />
    </IonPage>
  );
}

export default App;
